  useEffect(()=>{
    getData()
  },[])

  async function getData(){
    fetch(`https://swapi.dev/api/films`)
      .then(response => response.json())
      .then(res => {
        console.log("respnse", res)
      })
      .catch((error) => console.log(error));
  }


  return (
    <div>
      <h1>Homepage</h1>
      <button title="go" onClick={()=> navigate('/details')}/>
    </div>
  )
}
